INSERT INTO `page_list` (`id`, `page_title`, `page_content`, `status`, `alias`) VALUES
(1, 'Strona Główna', '<h2 style=\"font-size: 2em; color: #2E8B57; text-align: center; font-family: \'Arial\', sans-serif;\">Witaj na stronie poświęconej hodowli żółwia wodnego!</h2>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif; text-align: justify;\">Cieszymy się, że tu jesteś! Nasza pasja do żółwi wodnych zainspirowała nas do stworzenia tego miejsca, w którym chcemy dzielić się wiedzą, doświadczeniem i miłością do tych fascynujących stworzeń. Żółwie wodne to nie tylko piękne zwierzęta, ale także wspaniali towarzysze, którzy mogą stać się częścią Twojego życia na wiele lat.</p>\r\n        \r\n<h2 style=\"font-size: 2em; color: #2E8B57; text-align: center; font-family: \'Arial\', sans-serif;\">Odkryj świat żółwi wodnych</h2>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif; text-align: justify;\">Na naszej stronie znajdziesz wiele cennych informacji dotyczących hodowli żółwi wodnych. Od porad dotyczących ich diety, przez odpowiednie warunki życia, aż po zdrowie i zachowanie – wszystko, co musisz wiedzieć, aby stworzyć swojemu żółwiowi idealne warunki do życia. Zachęcamy do eksploracji naszych artykułów, które pomogą Ci lepiej zrozumieć potrzeby tych niezwykłych zwierząt.</p>\r\n\r\n<h2 style=\"font-size: 2em; color: #2E8B57; text-align: center; font-family: \'Arial\', sans-serif;\">Twoja podróż z żółwiem wodnym</h2>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif; text-align: justify;\">Hodowla żółwia wodnego to nie tylko odpowiedzialność, ale także niesamowita przygoda. Każdy żółw ma swoją unikalną osobowość, a ich obserwacja potrafi przynieść wiele radości. W miarę jak poznajesz swojego nowego przyjaciela, odkryjesz, jak ważne jest zrozumienie jego potrzeb i zachowań. Pamiętaj, że każdy krok, który podejmujesz, ma znaczenie dla zdrowia i szczęścia Twojego żółwia. Jesteśmy tu, aby pomóc Ci na każdym etapie tej niezwykłej podróży, dzieląc się praktycznymi wskazówkami oraz inspiracjami. Razem stworzymy harmonijną przestrzeń, w której Twój żółw będzie mógł rozkwitać!</p>\r\n\r\n<img style=\"display: block; width: 500px; height: auto; margin-left: auto; margin-right: auto; border-radius: 8px;\" src=\"./images/g_1.webp\" alt=\"zolwik\">\r\n\r\n<h2 style=\"font-size: 2em; color: #2E8B57; text-align: center; font-family: \'Arial\', sans-serif;\">Zmień tło</h2>\r\n<form method=\"post\" name=\"background\" style=\"text-align: center; margin-top: 20px;\">\r\n    <input type=\"button\" value=\"obrazek\" onclick=\"changeBackgroundToImage()\" style=\"padding: 10px 20px; background-color: #FF8000; color: white; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"żółty\" onclick=\"changeBackground(\'#FFF000\')\" style=\"padding: 10px 20px; background-color: #FFF000; color: black; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"czarny\" onclick=\"changeBackground(\'#000000\')\" style=\"padding: 10px 20px; background-color: #000000; color: white; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"biały\" onclick=\"changeBackground(\'#FFFFFF\')\" style=\"padding: 10px 20px; background-color: #FFFFFF; color: black; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"zielony\" onclick=\"changeBackground(\'#00FF00\')\" style=\"padding: 10px 20px; background-color: #00FF00; color: black; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"niebieski\" onclick=\"changeBackground(\'#0000FF\')\" style=\"padding: 10px 20px; background-color: #0000FF; color: white; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"pomarańczowy\" onclick=\"changeBackground(\'#FF8000\')\" style=\"padding: 10px 20px; background-color: #FF8000; color: white; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"szary\" onclick=\"changeBackground(\'#c0c0c0\')\" style=\"padding: 10px 20px; background-color: #c0c0c0; color: black; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n    <input type=\"button\" value=\"czerwony\" onclick=\"changeBackground(\'#FF0000\')\" style=\"padding: 10px 20px; background-color: #FF0000; color: white; border: none; border-radius: 5px; cursor: pointer; margin: 5px;\">\r\n</form>\r\n', 1, 'glowna'),
(2, 'O żółwiu wodnym', '<img style=\"float: left; width: 300px; margin-right: 15px; border-radius: 8px; box-shadow: 0 4px 8px rgba(0,0,0,0.1);\" src=\"./images/o_z1.jpg\">\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Żółw wodny to fascynujący gatunek, który żyje w różnych częściach świata. Ma wydłużone ciało, zakończone ogonem i skrzydłami. Żółw wodny jest dobrze dostosowany do życia w wodzie, ale może też przebywać na lądzie. Jego skóra jest lekka i elastyczna, co pozwala mu pływać szybciej niż większość gatunków żółwi.</p>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Żółw wodny ma długą głowę z dużymi ośmiorniczymi ośmiornicami, które są jego głównym źródłem pożywienia. Żyje zazwyczaj od 30 do 50 lat w naturze, choć w niewoli może żyć nawet do 80 lat. Żółw wodny jest roślinożercą, więc żywi się głównie algami, mchami i innymi roślinami wodnymi.</p>\r\n\r\n<img style=\"float: right; width: 300px; margin-left: 15px; border-radius: 8px; box-shadow: 0 4px 8px rgba(0,0,0,0.1);\" src=\"./images/o_z2.jpg\">\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Gdy żółw wodny staje się dorosłym, samica składa jaja w ziemi lub w nory pod dnem jeziora. Samiec chroni jaja przez około 70 dni, dopóki nie wyklują się młode żółwie. Młode żółwie są bardzo wrażliwe na środowisko i potrzebują specjalnego miejsca do wychowania.</p>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Wiele gatunków żółwi wodnych jest zagrożonych, szczególnie ze względu na zmiany klimatu i utratę siedlisk. Niektóre gatunki są też chowane dla celów konsumpcji, co prowadzi do spadku populacji. Dlatego ważne jest dbanie o ochronę siedlisk i populacji tych fascynujących stworzeń.</p>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Żółw wodny jest bardzo inteligentne zwierzę. Potrafi rozwiązać problemy i uczyć się nowych umiejętności. W niewoli może być bardzo aktywnym i emocjonalnie zaangażowanym zwierzęciem, co sprawia, że wiele osób decyduje się na jego utrzymanie jako domowego zwierzaka.</p>\r\n\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Warto pamiętać, że choć żółw wodny może wyglądać jak zwierzę domowe, jest on dzikożyjącym gatunkiem i powinien być traktowany z należytym szacunkiem. Jego potrzeby są inne niż te zwierząt domowych, więc wymaga specjalnego utrzymania i opieki. Naukowcy odkryli, że niektóre gatunki żółwi wodnych mają zdolność do przeprowadzania kosmicznych podróży. W ciągu jednej nocy, wykorzystując siłę gwiazd, żółwie mogą pokonać dystans równy średniej odległości między Ziemią a Księżycem. Ich skorupa pełna mikrokrystalicznych cząsteczek pozwala im na lekką eksploatację siły grawitacyjnej.</p>\r\n\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Według mitologii, żółwie wodne są ustanowionym przez Boga strażnikami oceanów. Mają za zadanie chronić morza przed złymi duchami i potworami, które chciałyby je zniszczyć. Dla nagrodzenia ich służby, Bóg obdarzył je niezwykłą mocą - umiejętnością poruszania się w czasie.</p>\r\n\r\n<img style=\"float: left; width: 300px; margin-right: 15px; border-radius: 8px; box-shadow: 0 4px 8px rgba(0,0,0,0.1);\" src=\"./images/o_z3.webp\">\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Naukowcy odkryli, że żółwie wodne posiadają w swoim organizmie tajemnice ukryte w skorupie. Gdy żółwie są pod silnym presją emocjonalną, mogą otworzyć swoją skorupę i uwolnić tajemnice, które zawierają klucze do rozwiązania najtrudniejszych problemów naukowych.</p>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">Badania wykazują, że żółwie wodne praktykują niezwykle zaawansowaną formę medytacji. Mogą pozostać pod wodą przez godziny, skupieni na własnych myślach i emocjach. Ich umysły są tak spokojne, że nawet rybki zaczynają się modlić przy nich.</p>\r\n<p style=\"font-size: 1.1em; color: #333; line-height: 1.6; font-family: \'Verdana\', sans-serif;\">W dniach święta, żółwie wodne mają specjalny status. Zgodnie z legendą, w tym czasie mogą poruszać się po lądzie bezpiecznie, ponieważ wszyscy drzewa, kamienie i wody są dla nich magicznym pomiędzy światem. Można je więc spotkać na plażach, spacerującymi po ulicach miast czy nawet w centrum dużych miast.</p>\r\n', 1, 'o_zolwiu'),
(3, 'Gdzie kupić?', '<p class=\"content-text\">Żółwia wodnego można zdobyć na kilka sposobów, zależnie od tego, gdzie się znajdujesz i jaką ścieżkę wybierzesz. Wiele osób decyduje się na zakup żółwia w sklepach zoologicznych, które oferują szeroki wybór gatunków żółwi wodnych. W takich sklepach znajdziesz popularne gatunki, jak żółw czerwonolicy, żółw żółtobrzuchy czy żółw błotny. Zakup w sklepie to często wygodna opcja, ponieważ żółwie są dostępne od ręki, a personel sklepu może udzielić podstawowych informacji o ich wymaganiach. Warto jednak zwrócić uwagę na to, skąd pochodzi zwierzę, aby upewnić się, że zostało pozyskane legalnie i humanitarnie.</p>\r\n\r\n<img class=\"float-left\" src=\"./images/h_1.jpg\" alt=\"Żółw czerwonolicy\">\r\n<p class=\"content-text\">Innym sposobem na zdobycie żółwia wodnego jest zakup od prywatnych hodowców. Często oferują oni młode żółwie, które wychowywane są w domowych warunkach. Wiele osób decyduje się na tę opcję, ponieważ w hodowli zwierzęta mogą mieć lepsze warunki życia niż w dużych sklepach zoologicznych. Hodowcy często oferują żółwie z certyfikatami legalności pochodzenia, co daje pewność, że zwierzę nie pochodzi z nielegalnego handlu. Takie ogłoszenia można znaleźć na forach internetowych, w grupach na mediach społecznościowych, czy na specjalistycznych stronach dotyczących gadów.</p>\r\n\r\n<p class=\"content-text\">Jeśli szukasz żółwia wodnego, warto także sprawdzić ogłoszenia adopcyjne. Wiele organizacji zajmujących się ochroną zwierząt prowadzi akcje adopcyjne, oferując dorosłe żółwie, które z różnych powodów nie mogą pozostać w swoim pierwotnym środowisku. Adopcja to świetna opcja, zwłaszcza dla osób, które chcą pomóc zwierzętom w potrzebie. Zaletą adopcji jest to, że wiele z tych żółwi zostało już wstępnie przeszkolonych, a organizacje adopcyjne często zapewniają pomoc w przygotowaniu odpowiednich warunków do ich dalszej opieki. Warto także pamiętać, że adopcja jest bardziej etyczną opcją niż zakup żółwia, który mógłby pochodzić z nielegalnych źródeł.</p>\r\n\r\n<img class=\"float-right\" src=\"./images/o_z2.jpg\" alt=\"Adopcja żółwia wodnego\">\r\n<p class=\"content-text\">Jeśli decydujesz się na zakup żółwia, warto zwrócić uwagę na przepisy prawne dotyczące sprzedaży dzikich zwierząt w Twoim kraju. W niektórych miejscach obowiązują restrykcyjne przepisy regulujące handel żółwiami wodnymi, które mają na celu ochronę gatunków zagrożonych wyginięciem. Zanim dokonasz zakupu, upewnij się, że sprzedawca posiada odpowiednie dokumenty potwierdzające legalność pochodzenia zwierzęcia. Unikaj zakupu żółwi z niepewnych źródeł, ponieważ może to wiązać się z konsekwencjami prawnymi oraz przyczyniać się do nielegalnego handlu dzikimi zwierzętami.</p>\r\n\r\n<p class=\"content-text\">Kolejnym sposobem zdobycia żółwia wodnego jest udział w aukcjach lub targach zwierząt. W takich miejscach hodowcy, właściciele i handlarze często wystawiają swoje zwierzęta na sprzedaż. Chociaż takie miejsca mogą oferować okazje, warto być ostrożnym, ponieważ nie zawsze można zweryfikować źródło pochodzenia żółwi. Jeśli zdecydujesz się na tę opcję, zawsze sprawdź dokumenty i zapytaj o szczegóły dotyczące zwierzęcia oraz jego zdrowia.</p>\r\n\r\n<img class=\"float-left\" src=\"./images/h_3.jpg\" alt=\"Żółw wodny w akwarium\">\r\n<p class=\"content-text\">Jeśli nie chcesz kupować żółwia, a jednocześnie zależy Ci na posiadaniu tego wyjątkowego zwierzęcia, możesz poszukać ogłoszeń dotyczących podarowania żółwia. Często zdarza się, że osoby, które zmieniają miejsce zamieszkania lub nie mają odpowiednich warunków, decydują się na oddanie swojego żółwia do dobrego domu. Ogłoszenia o oddaniu żółwia można znaleźć w internecie, na stronach związanych z ochroną zwierząt, czy w grupach społecznościowych. Tego typu opcja jest dobrym rozwiązaniem, zwłaszcza jeśli chcesz zapewnić zwierzęciu nowy, lepszy dom.</p>\r\n\r\n<p class=\"content-text\">Bez względu na to, którą opcję wybierzesz, pamiętaj, że posiadanie żółwia wodnego wiąże się z odpowiedzialnością i dbałością o jego potrzeby. Żółwie wymagają odpowiedniego akwarium, diety, oświetlenia oraz stałej opieki zdrowotnej. Zanim zdecydujesz się na zakup lub adopcję żółwia, upewnij się, że jesteś w stanie zapewnić mu warunki, które umożliwią mu długie i zdrowe życie. Pamiętaj, że żółwie wodne to stworzenia, które mogą żyć nawet kilka dziesięcioleci, więc decyzja o ich posiadaniu jest decyzją na wiele lat.</p>\r\n\r\n<p class=\"content-text\">Podsumowując, jeśli chcesz zdobyć żółwia wodnego, masz do wyboru różne opcje. Możesz go kupić w sklepie zoologicznym, od prywatnych hodowców, przyjąć go z adopcji lub znaleźć ogłoszenia o podarowaniu żółwia. Ważne jest, aby wybrać odpowiednią drogę pozyskania, aby zapewnić zwierzęciu legalne, zdrowe i bezpieczne warunki do życia.</p>\r\n', 1, 'gdzie_kupic'),
(4, 'Hodowla', '<p class=\"content-text\"><u><b><i>Hodowla żółwi wodnych</i></b></u> to <span class=\"highlighted-text\">fascynujące</span> zajęcie, które wymaga odpowiedniego przygotowania, wiedzy oraz zaangażowania. Te wyjątkowe stworzenia potrafią być wspaniałymi towarzyszami, ale ich potrzeby są specyficzne i różnią się w zależności od gatunku. Przed przystąpieniem do hodowli warto poznać kilka podstawowych zasad dotyczących ich wymagań środowiskowych, diety oraz ogólnej opieki.</p>\r\n\r\n<img class=\"float-left\" src=\"./images/o_z3.webp\" alt=\"żółw wodny\">\r\n\r\n<p class=\"content-text\">Pierwszym krokiem w hodowli żółwi wodnych jest wybór odpowiedniego gatunku. Na rynku dostępnych jest wiele różnych gatunków, takich jak żółw błotny, żółw czerwonolicy czy żółw grecki. Każdy z nich ma swoje unikalne potrzeby, a także różne wymagania dotyczące wielkości akwarium, temperatury wody czy oświetlenia. Warto zwrócić uwagę na to, jakie warunki naturalne panują w ich naturalnym środowisku, aby móc jak najlepiej odwzorować je w domowej hodowli.</p>\r\n\r\n<p class=\"content-text\">Akwarium jest jednym z najważniejszych elementów w hodowli żółwi wodnych. Powinno być wystarczająco duże, aby zapewnić żółwiom przestrzeń do pływania i eksploracji. Zaleca się, aby dla jednego dorosłego żółwia wodnego akwarium miało co najmniej 100 litrów pojemności. Woda powinna być czysta i dobrze filtrowana, dlatego zainwestowanie w odpowiedni filtr jest kluczowe. Regularne zmiany wody są niezbędne, aby zapewnić zdrowie żółwi oraz zachować odpowiednie parametry wody, takie jak pH czy temperatura. W zależności od gatunku, temperatura wody powinna wynosić od 24 do 28 stopni Celsjusza.</p>\r\n\r\n<img class=\"float-right\" src=\"./images/h_2.jpg\" alt=\"żółw wodny - akwarium\">\r\n\r\n<p class=\"content-text\">Oświetlenie to kolejny istotny element. Żółwie wodne potrzebują zarówno światła UVB, które pomaga w syntezie witaminy D3, jak i jasnego światła, które stymuluje ich naturalne zachowania. Oświetlenie UVB powinno być stosowane przez 10-12 godzin dziennie. Warto umieścić źródło światła w taki sposób, aby żółwie miały możliwość wygrzewania się na powierzchni wody, co jest dla nich bardzo ważne.</p>\r\n\r\n<p class=\"content-text\">Kolejnym aspektem, na który należy zwrócić uwagę, jest stworzenie odpowiedniego środowiska w akwarium. Można to osiągnąć, dodając rośliny wodne, kawałki drewna, kamienie czy inne elementy, które żółwie mogą eksplorować i w których mogą się chować. Warto jednak pamiętać, aby elementy te były odpowiednio dobrane, ponieważ niektóre mogą być szkodliwe dla żółwi, a inne mogą szybko ulegać zniszczeniu w wodzie. Dobrze jest również stworzyć miejsce, w którym żółwie będą mogły odpoczywać na suchej powierzchni. Może to być na przykład wyspa, na której będą mogły się wygrzewać i suszyć.</p>\r\n\r\n<img class=\"float-left\" src=\"./images/h_3.jpg\" alt=\"żółw wodny na wyspie\">\r\n\r\n<p class=\"content-text\">Żółwie wodne są wszystkożerne, co oznacza, że ich dieta powinna być zróżnicowana. W ich jadłospisie nie może zabraknąć pokarmów roślinnych, takich jak sałata, szpinak czy brokuły, a także pokarmów białkowych, takich jak dżdżownice, krewetki czy komercyjnie dostępne granulaty. Ważne jest, aby dostarczać im odpowiednie witaminy i minerały, a także dbać o to, aby pokarm był świeży i wysokiej jakości. Regularne karmienie powinno odbywać się co najmniej dwa razy w tygodniu, przy czym warto dostosować ilość pokarmu do wieku i wielkości żółwia.</p>\r\n\r\n<img class=\"float-right\" src=\"./images/h_4.webp\" alt=\"karma dla żółwi\">\r\n\r\n<p class=\"content-text\">Ważnym elementem opieki nad żółwiami wodnymi jest monitorowanie ich zdrowia. Należy zwracać uwagę na wszelkie zmiany w zachowaniu, wyglądzie czy apetytach. Często spotykanym problemem są infekcje oczu lub skorupy, które mogą być spowodowane złymi warunkami życia. W przypadku zauważenia jakichkolwiek niepokojących objawów, warto skonsultować się z weterynarzem specjalizującym się w gadach. Regularne kontrole zdrowia powinny być częścią rutyny hodowlanej.</p>\r\n\r\n<p class=\"content-text\">Podsumowując, hodowla żółwi wodnych to zajęcie, które wymaga staranności i wiedzy. Kluczem do sukcesu jest stworzenie odpowiednich warunków życia, zapewnienie zróżnicowanej diety oraz regularna obserwacja ich zdrowia. Dzięki odpowiedniemu podejściu, żółwie mogą stać się wspaniałymi towarzyszami na wiele lat, a ich obecność będzie cieszyć zarówno właścicieli, jak i wszystkich domowników.</p>\r\n', 1, 'hodowla'),
(5, 'Galeria', '<h2 style=\"text-align: center;\">To są żólwie wodne!</h2>\r\n    <div class=\"images\">\r\n        <img class=\"galleryimg\" src=\"./images/g_1.webp\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_2.jpg\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_3.webp\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_4.jpg\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_5.webp\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_6.jpg\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_7.webp\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_8.jpg\" alt=\"zolwik\">\r\n        <img class=\"galleryimg\" src=\"./images/g_9.avif\" alt=\"zolwik\">\r\n\r\n    </div>', 1, 'galeria'),
(6, 'Filmy', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0IugWffMaGU?si=Dp9BMvVUgdThYsn8\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>\r\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/r43RmAE9U18?si=aETsCqUKH5Pzg1Cp\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>\r\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/KZWovmOWd5M?si=KqavMHAh20-C-TsJ\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>\r\n', 1, 'filmy'),
(7, 'Kontakt', '<form action=\"mailto:admin@example.com\" method=\"POST\" enctype=\"text/plain\" class=\"kontakt\">\r\n  <div class=\"form-group\">\r\n    <label for=\"subject\" class=\"form-label\">Temat:</label>\r\n    <input type=\"text\" class=\"form-control\" name=\"subject\" id=\"subject\" placeholder=\"Temat\">\r\n  </div>\r\n  <div class=\"form-group\">\r\n    <label for=\"message\" class=\"form-label\">Treść:</label>\r\n    <textarea class=\"form-control form-control-textarea\" name=\"message\" id=\"message\" rows=\"3\"></textarea>\r\n  </div>\r\n  <button type=\"submit\" class=\"btn btn-primary\">Wyślij</button>\r\n</form>', 1, 'kontakt');

